syntax = "proto3";
option java_multiple_files = true;
package com.mirsalakhov.socialmediaparser.grpc;

import "google/protobuf/empty.proto";
import "google/protobuf/timestamp.proto";

message ClientProxyResponse {
  string type = 1;
  string hostname = 2;
  int32 port = 3;
  string username = 4;
  string password = 5;
}